import { deleteColor } from '../../ColorPickerScripting'; 

function DeleteColorModal(props) {
    return(
        <div className="DeleteColorModal" >
            <div className="ModalBackground">
                <div className="ModalContainer">
                    <h1>{"Are You Sure You Want To Delete Color: " + props.colorList[props.color].name}</h1>
                    <div className="Buttons">
                        <button onClick={() => {deleteColor(props.colorList, props.color, props.isProject); props.modalOpen(false);}}>Confirm</button>
                        <button onClick={() => props.modalOpen(false)}>Cancel</button>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default DeleteColorModal;
